import React from 'react';
import api from "../server_api/api";

class GetDataFeomUser extends React.Component{
    constructor(props) {
        super(props);
        this.state = {


        };

    }
    async componentDidMount() {
        const data = await api.getCitiesName();
        this.setState({
            city_list: data.data
        });
        console.log(this.state.city_list)
    }

    handleChange({target:{name,value}}){
        this.setState({
            [name]: {
                ...this.state[name],
                value,
            }
        });
    }

    handleSubmit = (event)=> {
        event.preventDefault();
    };

    render() {
        return(
            <div>
                <h1>rang</h1>
                <form action="" method="post" name="login" onSubmit={this.handleSubmit}>
                    <div className="col-md-4 mb-3">
                        <label className={"input_label"} htmlFor="validationDefault01">min number</label>
                        <input  className="form_input" type="number" min={0} name="number_of_room" placeholder="Enter min number" onBlur={this.handleChange} />
                    </div>
                    <div className="col-md-4 mb-3">
                        <label className={"input_label"} htmlFor="validationDefault01">max number</label>
                        <input  className="form_input" type="number" min={0} name="number_of_room" placeholder="Enter max number" onBlur={this.handleChange} />
                    </div>

                </form>
            </div>
        )
    }
}

export default GetDataFeomUser;
